import React from 'react';
import { NavLink } from "react-router-dom";
import { BsInstagram, BsTiktok } from "react-icons/bs";

const Navbar: React.FC = (props) => {



    const setNavbar = () => {
        const navbar1 = document.getElementById('navbar1');
        const navbar2 = document.getElementById('navbar2');
        const navbar3 = document.getElementById('navbar3');

        if(navbar1 != null && navbar2 != null && navbar3 != null) {
            navbar1.style.backgroundColor = '#ff0000';
            navbar2.style.backgroundColor = '#ff0000';
            navbar3.style.backgroundColor = '#ff0000';
        }
    }

    return(
        <>
            <div id="navbar1" className='shadow-md w-full fixed top-0 left-0'>
                <div id="navbar2" className='md:flex items-center justify-between bg-orange-400 py-4 md:px-10 px-7'>
                    <div className='cursor-pointer flex items-center ml-8' onClick={setNavbar}>
                        {/* <NavLink to="/"> */}
                            <img alt='logo' className='w-20 h-20' src={require("../images/ss-logo.png")} />
                        {/*</NavLink>*/}
                    </div>
                    <div>

                    </div>
                    <ul id="navbar3" className='md:flex md:items-center md:pb-0 pb-18 absolute md:static bg-orange-400 md:z-auto z-[-1] left-0 w-full md:w-auto md:pl-0 pl-9 transition-all  ease-in'>
                        {/*
                            <li className='h-2'>
                            {/* To fix the navbar snap to mobile */
                            /*</li>
                            */
                        }
                        <li className='md:ml-8 text-xl'>
                            <NavLink to="/hidden">
                                <p className='font-marker text-orange-400 hover:text-white duration-500'>hemmelig</p>
                            </NavLink>
                        </li>
                        <li className='md:ml-8 text-xl'>
                            <NavLink to="/gallery">
                                <p className='font-marker hover:text-white duration-500'>gallery</p>
                            </NavLink>
                        </li>
                        <li className='md:ml-8 text-xl md:my-0 my-7'>
                            <NavLink to="/newsletter">
                                <p className='font-marker hover:text-white duration-500'>newsletter</p>
                            </NavLink>
                        </li>
                        <li className='md:ml-8 text-xl md:my-0 my-7'>
                            <NavLink to="/contact">
                                <p className='font-marker hover:text-white duration-500'>contact</p>
                            </NavLink>
                        </li>
                        <li className='md:ml-8 text-2xl md:my-0 my-7'>
                            <a href="https://www.instagram.com/sketchsauceno/">
                                <BsInstagram className='hover:text-white duration-500' />
                            </a>
                        </li>
                        <li className='md:ml-4 text-2xl md:my-0 my-7'>
                            <a href="https://www.tiktok.com/@sketchsauce">
                                <BsTiktok className='hover:text-white duration-500' />
                            </a>
                        </li>
                    </ul>
                </div>
            </div>
        </>
    );
}

export default Navbar;
